import tensorflow as tfimport numpy as npn_input = 10n_hidden = 20b = 32t = 10tf.zeros([32])x = tf.zeros([b, t, 5])l = tf.constant([np.random.random_integers(0, t) for _ in range(b)])rnn_cell = tf.nn.rnn_cell.LSTMCell(n_hidden)# generate predictioninitial_state = rnn_cell.zero_state(b, dtype=tf.float32)outputs, states = tf.nn.dynamic_rnn(rnn_cell, x, sequence_length=l, initial_state=initial_state, dtype=tf.float32,)print(outputs)print(states)tf.InteractiveSession()